import Vue from 'vue'
import App from './App.vue'
// 全局组件(三级联动组件)

// 引入路由
import router from '@/router'


new Vue({
  render: h => h(App),
  // 注册路由(简写形式key与value一致)
  router
}).$mount('#app')
